                        	// This stops the player after moving close enough.
                        	if (Me.Focus != null && Me.Focus.Distance2D < 35.0)
                        	{
                            		MoveToStop();
                            		break;
                        	}
                    	}
                    
                    	if (Me.Focus.Distance2D > 14 && Me.Focus.Distance2D < 35.0)
                    	{
                        	// Hurl Boulder
                        	MoveToStop();
                        	Print("Hurling Boulder!");
                        	ExecuteLua("OverrideActionBarButton1:Click()");
                        	distance1 = Me.Focus.Distance2D;
                        	yield return 100;
                        	distance2 = Me.Focus.Distance2D;
				// Position check. If distance is less, unit is moving closer to us.  Used predictive positioning instead.
                        	if (distance2 < distance1)
                        	{
                            		ClickOnTerrain(Me.Focus.PositionPredicted);
                        	}
                        	else
                        	{
                            		ClickOnTerrain(Me.Focus.Position);
                        	}
                       		yield return 2800;
			}
		}

		if (QH.RemainingSpellCD(160283) == 0) 
                {
