                    	yield return 500;
                }
                // Hurl Boulder
                else if (QH.RemainingSpellCD(160142) == 0 && Me.Focus.Distance2D >= 6.0)
                {
                    	MoveToStop();
                    	Print("Hurling Boulder!");
                    	ExecuteLua("OverrideActionBarButton1:Click()");
                    	yield return 100;
                    	ClickOnTerrain(Me.Focus.Position);
                    	yield return 1300;
                }
