                {
                    	Print("Burn! Flame Vents!!!");
                    	ExecuteLua("OverrideActionBarButton2:Click()");
                    	yield return 2000;
                }
                // Between each check...
                yield return 100;
	}

	if (Me.IsOnTransport)
